window.bookSummaryJSON = "<p>Daemon's determined to prove what he feels for Katy is more than a product of their bizarro connection. So she's sworn him off, even though he's running more hot than cold these days. But they've got bigger problems.The Department of Defense is here. If they ever find out what Daemon can do and that Katy and Daemon are linked, Katy's a goner. So is he. And there's this new boy in school who's got a secret of his own. He knows what's happened to Katy and he can help, but to do so, Katy has to lie to Daemon and stay away from him. Like that's possible. Against all common sense, Katy's falling for Daemon. Hard. </p> <p>Katy's seen someone who shouldn't be alive. And she has to tell Daemon, even though he'll never stop searching until he gets the truth. What happened to his brother? Who betrayed him? And what does the DOD want from them - from her? </p> <p>No one is who they seem. And not everyone will survive the lies....</p>"; 
